             backgroundColor: 'white',
             position: 'fixed',
             height: '100vh',
             width: '30vw',
             fontSize: '30px'
        }}>
            <Menu>업체소개</Menu>
            <Menu>갤러리</Menu>
            <Menu>공지사항</Menu>
            <Menu>온라인문의</Menu>
            <Menu>오시는길</Menu>
        </div>
    )
}

export default Menubar

const Menu = styled.div`
    margin: 30px;
`;
